import React from 'react'

const DUMMY_EVENTS = [
  { id: 'e1', title: 'some event'},
  { id: 'e2', title: 'another event'},
]
const EventsPage = () => {
  return (
    <>
    <div>EventsPage</div>
    <ul>
        {DUMMY_EVENTS.map(event => <li>{event.title}</li>)}
    </ul>
    </>
  )
}

export default EventsPage
